//Import the Link API
import Link from 'next/Link';

const linkStyle = {
  fontSize: '15px',
  marginLeft: '15px',
  paddingTop: '2.5px',
  color: 'black',
};

export default () => (
    <div>
        <Link href='/' >
            <a style={linkStyle} >HOME</a>
        </Link>
        <Link href='/selected' >
            <a style={linkStyle} >SELECTED</a>
        </Link>
    </div>
);
